import styled from "@emotion/styled";

export const Container = styled.div`
    background: linear-gradient(to bottom, #33ccff 0%, #ffcc99 100%);
    width: 100%;
    min-height: 100vh;
    display: flex;
    justify-content: center;
    align-items: center;

`

export const AppWrapper = styled.div`
    background: linear-gradient(to bottom, #ff9966 0%, #99ccff 100%);
    min-width: 450px;
    min-height: 650px;
    padding: 40px;
    box-sizing: border-box;
    border-radius: 10px;
    box-shadow: 3px 6px 40px #000;
    margin-bottom: 10px;
`

export const body = styled.animate`
    margin: 0;
    padding: 0;
`
